INSERT INTO `wn_blogs` (`id`, `category_id`, `title`, `text`, `timestamp`, `user_key`) VALUES
(1, 31, 'Sharp: We''re shipping iPhone 5 displays this month', '<p>(Credit: Apple)Sharp is producing the screen for Apple''s next iPhone and will have it ready to shipa</p>', '1343934425', 'cad3619dacaf28355c0fe98d239e134c'),
(2, 31, 'Google Updates The Gmail Android App, Now Works Better With 7-inch Tabs', 'The latest Gmail Android app update brings several new features, but this is a must-have for 7-inch tablets. Google slightly reworked the UI and it now works better with 7-inch tablets. Previously, when in landscape mode, the app would occasionally abruptly cut off messages. Thatâ€™s now fixed for 7-inch tablets running Android 4.0 or later. But sorry, kids, the app is still missing pinch-to-zoom within messages.The new version also brings a new label API for 3rd-party developers, a feature likely related to homescreen widgets.This update comes a few weeks after Google released the Nexus 7 to the retail market. Users quickly discovered that Gmail, one of the Nexus 7â€²s core apps, wasnâ€™t as polished as shiny as it should have been. The updated version<span class="Apple-converted-space">&nbsp;</span><a target="_blank" href="https://play.google.com/store/apps/details?id=com.google.android.gm&amp;hl=en" style="font-weight: bold; text-decoration: none; color: rgb(10, 150, 0); outline-style: none; ">is now available from Google Play</a>, which should apply the appropriate sheen to the app. <br>Source:<a href="http://techcrunch.com/2012/08/02/google-updates-the-gmail-android-app-now-works-better-with-7-inch-tabs/?utm_source=feedburner&amp;utm_medium=feed&amp;utm_campaign=Feed%3A+Techcrunch+%28TechCrunch%29">http://techcrunch.com/2012/08/02/google-updates-the-gmail-android-app-now-works-better-with-7-inch-tabs/?utm_source=feedburner&amp;utm_medium=feed&amp;utm_campaign=Feed%3A+Techcrunch+%28TechCrunch%29</a>', '1343934924', 'cad3619dacaf28355c0fe98d239e134c'),
(3, 31, 'MoneyDesktop Makes Second Acquisition In Eight Months In MoneyReef, Preps iPhone And iPad Launches', '<p>MoneyDesktop&nbsp;has acquired&nbsp;MoneyReef, a financial management application company focused ontest</p>', '1343935169', 'cad3619dacaf28355c0fe98d239e134c'),
