INSERT INTO `wn_events` (`id`, `title`, `text`, `location`, `event_date`, `user_key`, `timestamp`) VALUES
(1, 'London 2012 Olympic Games Closing Ceremony', '<p>London 2012 Closing CeremonyExpect breathtaking sights, sounds and performances showcasing some of tsdasdasdtestasdaasdsdsdasd</p>', '2012 Olympic Park and Village', '2012-08-12', 'cad3619dacaf28355c0fe98d239e134c', '1343935492'),
(2, 'London 2012 Olympic Games: Archery', '<h2 >Archery at London 2012</h2>See which individuals and teams hold their nerve the best in this test of mental strength, pinpoint accuracy and steady hands.The Archery competition sees men and women competing in both individual and team events. There are four gold medals to be won between 128 athletes, who will be whittled down in a series of knockout rounds.The athletes fire their arrows at an incredible 150 miles (241km) per hour from a distance of 70m (230ft), with the aim of hitting as close to the centre of the five-ringed target as possible.The difference between winning and losing can be a matter of just a few centimetres.<p>Source: <br></p><p>http://www.visitlondon.com/events/detail/9277623-london-2012-olympic-games-archery</p>', 'Lord''s Cricket Ground', '2012-08-27', 'cad3619dacaf28355c0fe98d239e134c', '1343935558'),
