(1, 1, 'test', 'test', '1345049075', '73c2fb8f235c82387747e3e7c9048fd7'),
(2, 11, 'Way of the Samurai 4', '<span style="color: rgb(58, 58, 58); font-family: arial, helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none; ">Way of the Samurai 4 is an open-world action title that takes players on a journey through post-isolationist Japan.</span>', '1346324657', 'cad3619dacaf28355c0fe98d239e134c'),
(3, 11, 'The Last Story', '<span style="color: rgb(58, 58, 58); font-family: arial, helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none; ">The Last Story marks the reunion of two luminaries that helped shape the RPG genre; Hironobu Sakaguchi and Nobuo Uematsu.</span>', '1346324687', 'cad3619dacaf28355c0fe98d239e134c');
