INSERT INTO `wn_group_events` (`id`, `group_id`, `title`, `text`, `location`, `event_date`, `user_key`, `timestamp`) VALUES
(1, '1', 'Archery at London 2012', '2012-08-27 <br> Lord''s Cricket Ground <br> <h2>Archery at London 2012</h2>See\n which individuals and teams hold their nerve the best in this test of \nmental strength, pinpoint accuracy and steady hands.The Archery \ncompetition sees men and women competing in both individual and team \nevents. There are four gold medals to be won between 128 athletes, who \nwill be whittled down in a series of knockout rounds.The athletes fire \ntheir arrows at an incredible 150 miles (241km) per hour from a distance\n of 70m (230ft), with the aim of hitting as close to the centre of the \nfive-ringed target as possible.The difference between winning and losing\n can be a matter of just a few centimetres.<p>Source: <br></p><p>http://www.visitlondon.com/events/detail/9277623-london-2012-olympic-games-archery</p> <br>\n		Attending:  No events 	', 'London', '2012-08-27 ', 'cad3619dacaf28355c0fe98d239e134c', '1343936309'),
(2, '11', 'Game Developers Conference', '<span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.77777862548828px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none; ">Annual March<span class="Apple-converted-space">&nbsp;</span></span><em style="font-weight: bold; font-style: normal; color: rgb(0, 0, 0); font-family: arial, sans-serif; font-size: small; font-variant: normal; letter-spacing: normal; line-height: 17.77777862548828px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">conference</em><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.77777862548828px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none; "><span class="Apple-converted-space">&nbsp;</span>on<span class="Apple-converted-space">&nbsp;</span></span><em style="font-weight: bold; font-style: normal; color: rgb(0, 0, 0); font-family: arial, sans-serif; font-size: small; font-variant: normal; letter-spacing: normal; line-height: 17.77777862548828px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">game</em><span style="color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: small; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.77777862548828px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none; "><span class="Apple-converted-space">&nbsp;</span>development, sharing tools, tips and technologies for unbridled professional learning, networking and fun.</span>', 'China', '2013-05-03', 'cad3619dacaf28355c0fe98d239e134c', '1346325012'),
