INSERT INTO `wn_news` (`id`, `title`, `text`, `timestamp`, `user_key`) VALUES
(1, 'Special Offer - buy the social script now at $20', 'Special Offer - buy the social script now at $20', '1346321763', 'cad3619dacaf28355c0fe98d239e134c'),
(2, 'Asus to base Windows 8 device pricing on new iPad', '<div class="postBody txtWrap" section="txt" style="margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; line-height: 1.333em !important; float: left; width: 620px; "><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 1em; font-style: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 1.333em !important; ">Asus will peg pricing of some upcoming Windows 8 devices to Apple''s new&nbsp;<a href="http://reviews.cnet.com/ipad-3/" section="luke_topic" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">iPad</a>, according to a report citing comments from President Jerry Shen.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 1em; font-style: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 1.333em !important; ">The company will "use the price of Apple''s new iPad as a reference" when pricing Windows 8 and Windows RT devices, Shen said during the company''s&nbsp;<a href="http://usa.asus.com/Pages/Investor/" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">second-quarter earnings conference call</a>, according to a&nbsp;<a href="http://www.digitimes.com/news/a20120829PD227.html" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">report</a>&nbsp;in Digitimes.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 1em; font-style: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 1.333em !important; ">The report did not specify what "reference" means exactly, i.e., whether, for example, an Asus Windows RT&nbsp;<a href="http://reviews.cnet.com/tablets/" section="luke_topic" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">tablet</a>&nbsp;would be priced to compete directly with the upcoming iPad or whether it would be used as a loose pricing guideline.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 1em; font-style: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 1.333em !important; ">Shen also addressed Microsoft''s upcoming Windows 8 Surface tablet products, saying "if Microsoft launches its Surface at US$199...it will cause difficulty for [the survival of] Asustek''s Windows-based tablet," according to the report.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 1em; font-style: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 1.333em !important; ">He also mentioned that Google''s Nexus 7 tablet, which Asus manufactures, will provide a big boost for the company''s tablet shipments.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 1em; font-style: inherit; font-family: inherit; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 1.333em !important; ">Asus&nbsp;<a href="http://www.chinapost.com.tw/business/global-markets/2012/08/30/352707/AsusTek-pre-tax.htm" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">reported consolidated revenue of NT$94.197 billion</a>&nbsp;(US$3.15 billion) for the second quarter, up four percent from the first quarter. Operating profit and pre-tax profit were both the highest in two years.</p></div>', '1346321842', 'cad3619dacaf28355c0fe98d239e134c'),
(3, 'Phones will get all charged up about new Ultrabook feature', '<span style="color: rgb(0, 0, 0); font-family: Helvetica, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19.983333587646484px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none; ">Intel is hoping that the relationship between your cell phone and a future Ultrabook will be nothing short of electric.</span><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">A post on the<span class="Apple-converted-space">&nbsp;</span><a href="http://blogs.intel.com/technology/2012/08/wireless-charging-technology---one-step-closer-to-reality/" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">company blog</a><span class="Apple-converted-space">&nbsp;</span>today announced that Integrated Device Technology will develop and deliver the chipsets that will enable some future Ultrabooks to wirelessly charge certain devices.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">The creatively-dubbed Wireless Charging Technology by Intel (WCT) is pretty simple. Just put your juice-impaired gadget within about an inch or so of a WCT-enabled Ultrabook with WCT detection software running. The laptop will couple with the mobile device and begin transferring energy wirelessly, as if conducted by the ghostly hand of<span class="Apple-converted-space">&nbsp;</span><a href="http://news.cnet.com/8301-1023_3-57497832-93/tesla-museum-fundraising-effort-hits-$850k-goal-in-one-week/" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">Nikola Tesla</a>himself.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">Intel says that within an hour, a depleted phone can be charged enough to "make it through the afternoon."</p>', '1346323204', 'cad3619dacaf28355c0fe98d239e134c'),
(4, 'At $249, the iPad Mini would be hard to stop, says analyst', '<p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">Will Apple lowball the<span class="Apple-converted-space">&nbsp;</span><a href="http://reviews.cnet.com/ipad-3/" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">iPad</a><span class="Apple-converted-space">&nbsp;</span>Mini? That''s a crucial question for competitors staring down the barrel of a smaller Apple<span class="Apple-converted-space">&nbsp;</span><a href="http://reviews.cnet.com/tablets/" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">tablet</a>, an analyst told CNET.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">The answer comes down to whether Apple wants to "crush the opposition" or just maintain dominance, said Rhoda Alexander, an analyst at IHS iSuppli. "And the price point would be how they do that," she said.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">While a $299 price tag "would sit in a more comfortable place as far as a profit," Alexander believes Apple could go as low as<span class="Apple-converted-space">&nbsp;</span><a href="http://www.tech-thoughts.net/2012/08/ipad-mini-bom-299-price.html#.UD7RaWie7ja" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">$249</a><span class="Apple-converted-space">&nbsp;</span>for an entry level model.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">At the high end, $349 is price Alexander often hears. That model would come with<span class="Apple-converted-space">&nbsp;</span><a href="http://en.wikipedia.org/wiki/LTE_(telecommunication)" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">4G LTE</a>.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">And it''s probably not a stretch to say that Google is already anticipating the imminent arrival of the iPad Mini in the U.S. Ads for the $199<span class="Apple-converted-space">&nbsp;</span><a href="http://reviews.cnet.com/google-nexus-7/" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">Nexus 7 tablet</a><span class="Apple-converted-space">&nbsp;</span>are everywhere these days, including Google''s usually-pristine search page.</p>', '1346323332', 'cad3619dacaf28355c0fe98d239e134c'),
(5, 'Amazon Publishing''s New York imprint deal with Ingram will allow competitors such as Apple and Barnes & Noble to offer Amazon titles.', '<p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">An Amazon publishing division has inked a partnership with a book distributor that could help ease some of the tension in the e-book industry.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">Amazon''s New York-based book publishing imprint signed a deal with book distributor Ingram Content Group that will allow Amazon competitors such as Apple and Barnes &amp; Noble to sell Amazon titles,<span class="Apple-converted-space">&nbsp;</span><a href="http://paidcontent.org/2012/08/29/exclusive-amazon-ny-to-sell-its-ebooks-through-bn-kobo-other-retailers/" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">PaidContent</a><span class="Apple-converted-space">&nbsp;</span>reported today.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">"We welcome Amazon Publishing''s New York adult group to the growing list of publishers who use our service," Phil Ollila, Ingram Content Group''s chief content officer, told PaidContent. The partnership does not include Amazon''s West Coast imprints.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">Tensions between Amazon and Barnes &amp; Noble, the world''s largest brick-and-mortar bookseller, began to flare when Amazon introduced the<span class="Apple-converted-space">&nbsp;</span><a href="http://reviews.cnet.com/tablets/amazon-kindle-fire/4505-3126_7-35022491.html" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">Kindle Fire</a><span class="Apple-converted-space">&nbsp;</span>and announced an exclusive deal with DC Comics to sell digital copies of 100 of DC''s graphic novels exclusively on the Fire.</p>', '1346323368', 'cad3619dacaf28355c0fe98d239e134c'),
(6, 'The mirco-blogging site rolls out a certification program for the type of developers they want to see more of.', '<p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">Twitter<span class="Apple-converted-space">&nbsp;</span><a href="https://dev.twitter.com/blog/twitter-certified-products" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">launched a certification program today</a><span class="Apple-converted-space">&nbsp;</span>that clearly identifies which Twitter-based services the company values, no doubt further upsetting<a href="http://news.cnet.com/8301-1023_3-57495850-93/developers-slam-twitters-new-restrictions-on-access/" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">developers who have been left out</a><span class="Apple-converted-space">&nbsp;</span>of Twitter''s good graces.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">The micro-blogging site is focused on promoting companies that "bring some of the most innovative products and services" to businesses and organizations, according to<span class="Apple-converted-space">&nbsp;</span><a href="https://dev.twitter.com/blog/twitter-certified-products" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">a blog post</a><span class="Apple-converted-space">&nbsp;</span>from Seth Bindernagel, who works on platform marketing for Twitter.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">Twitter recently<a href="http://news.cnet.com/8301-1023_3-57503077-93/twitter-gives-some-developers-literal-stamp-of-approval/Twitter%20recently%20tightened%20its%20restrictions%20for%20developers" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; "><span class="Apple-converted-space">&nbsp;</span>tightened its restrictions for developers</a>, drawing ire from some but solidifying its relationships with developers who created products that tie Twitter into the business world.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">These developers include the<span class="Apple-converted-space">&nbsp;</span><a href="https://dev.twitter.com/programs/twitter-certified-products/products" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">12 companies</a><span class="Apple-converted-space">&nbsp;</span>that are in Twitter''s new program for now. But Twitter is looking for more companies to come into the fold, Bindernagel writes.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">"While not every applicant may be a fit, we are very interested to learn more about your products and will get back to each application as soon as we can," he wrote.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">The program, which features three shiny blue seals of approval, is for companies that fall into three categories: engagement, analytics and data resellers.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">Engagement products, like SocialFlow or Mass Relevance, cover services that help brands engage with customers, while analytics products are ones that capture what customers are saying on Twitter, like Dataminr or Crimson Hexagon. Some of companies, like Hootsuite and Radian6, fall into both.</p>', '1346323409', 'cad3619dacaf28355c0fe98d239e134c'),
(7, 'Google wants to shop Motorola''s TV set-top biz around', '<p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">Google appears itching to<span class="Apple-converted-space">&nbsp;</span><a href="http://www.bloomberg.com/news/2012-08-29/google-said-to-hire-barclays-to-sell-motorola-s-home-business.html" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">get rid of the television set-top box business</a><span class="Apple-converted-space">&nbsp;</span>it inherited from the acquisition of Motorola Mobility.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">The Internet search giant has hired Barclays to help it find buyers, according to Bloomberg, which cited anonymous sources and said the home business unit might fetch $2 billion.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); ">That Google wants to sell Motorola''s set-top box business and focus on smartphones isn''t surprising; speculation of its desire to shed the business has popped up on numerous occasions. Google instead wants to mine Motorola''s patent portfolio for a more potent legal weapon against Apple, as well as focus on mobile devices with the smartphone and<span class="Apple-converted-space">&nbsp;</span><a href="http://reviews.cnet.com/tablets/" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">tablet</a><span class="Apple-converted-space">&nbsp;</span>business.</p><p style="margin: 10px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 15px; font-weight: normal; font-style: normal; font-family: Helvetica, Arial, sans-serif; text-align: left; vertical-align: baseline; -webkit-font-smoothing: subpixel-antialiased; line-height: 19.983333587646484px; color: rgb(0, 0, 0); font-variant: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); "><a href="http://www.lightreading.com/document.asp?doc_id=223597&amp;site=lr_cable" style="margin: 0px; padding: 0px; border: 0px; outline: none; font-size: inherit; font-weight: inherit; font-style: inherit; font-family: inherit; text-align: left; vertical-align: baseline; color: rgb(41, 100, 191); text-decoration: none; cursor: pointer; ">Light Reading Cable</a><span class="Apple-converted-space">&nbsp;</span>also reported earlier this month that Google wanted to put up the assets, and valued them at $2 billion.</p>', '1346323475', 'cad3619dacaf28355c0fe98d239e134c');
